import logo from './logo.svg';
import './App.css';

let btnIdx = 0;

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="App-title">
          Gym Battles {btnIdx}
        </p>
        <p className="App-header-btn">
          Create Session
        </p>
        <p className="App-header-btn">
          Join Session
        </p>
      </header>
    </div>
  );
}

export default App;
